import axios from "axios";
import React, { useEffect, useState } from "react";


const AdmProf = () => {

    const [responsa, setResponse] = useState('')

    useEffect(() => {
        axios.get('http://localhost:3001/getInfoAlunos').then((response) => {
            setResponse(response.data)
        })
        setResponse(JSON.stringify(localStorage.getItem('ProfessorInfo')))
        console.log(responsa)
    }, [])

    return (
        <div>
            <center>
                <h1>Olá Administrador/Professor {responsa} </h1> <br />
                <h3>Abaixo, estara uma lista com todos os alunos matriculados.</h3>
                <span></span>
            </center>
        </div>
    )
}





export default AdmProf
